import Image from '../../components/Image/Image'

const Clients = ({className, data}) => {
  const {lightThemeClients, darkThemeClients} = data
  
  lightThemeClients.map(client => console.log(client))

  return (
    <section>
      {lightThemeClients.map(client => <Image dataType={className} image={client} key={client.source}/>)}
    </section>      
  )
}

export default Clients

